#ERROR- Memory Limit Exceeded	

class Solution:
    def findSubstring(self,s, words):
        
        ln  = len(words)
        if ln ==0:
            return 
        
        lns = len(s)
         
        import itertools
        d  = dict()
        perm = itertools.permutations(words,ln)
        for i in perm:
            key = "".join(i)
            if key in d.keys():
                d[key] =+1
            else:
                d[key] =1
            
        res = set()
        for  i in d.keys():
            for j in range (0,lns):
                try:
                  loc = s[j:].index(i)
                  res.add(loc+j)
                except:
                    continue
        return res 
    
s = ""
words = ["dhvf","sind","ffsl","yekr","zwzq","kpeo","cila","tfty","modg","ztjg","ybty","heqg","cpwo","gdcj","lnle","sefg","vimw","bxcb"]
obj = Solution()
print (obj.findSubstring(s, words))
